import React, {Component} from 'react'
import Wandering from '../images/mindfulness.jpg'
import Navbar from '../components/Navbar'

class Lost extends Component{
    render(){
        return(
        <div className="profile" style = {{fontSize: "32px", 
        fontFamily:"Montserrat", 
        textAlign:"center",}}>
            <Navbar></Navbar>
                <h2 style = {{marginTop:"10%"}}>Oops! We can't find that page!
                </h2>
                    <img src={Wandering} alt="" style = {{
                        display:"block",
                        marginLeft:"auto",
                        marginRight:"auto",
                        width:"25%",
                        marginTop:"5%"
                    }}/>
                <h3><a href="/dashbard">Home</a></h3>
        </div>
        )
    }     
}
export default Lost;
